import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { DropdownButton, Dropdown } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const Targets = () => {
  const handleSelect = (eventKey) => {
    // Handle the selected item here if needed
    console.log(`Item with event key "${eventKey}" selected.`);
  };

  return (
    <div
      className="container-fluid bg-secondary d-flex justify-content-center align-items-center"
      role="group"
      aria-label="Button group with nested dropdown"
      style={{ height: '90vh' }}
    >
      <DropdownButton
        id="dropdown-basic-button"
        title="Please Select A Target"
        variant="danger"
        size="lg"
        onSelect={handleSelect}
      >
        <Dropdown.Item eventKey="1">
          <Link to="/Davis" style={{ textDecoration: 'none', color: 'inherit' }}>
            Davis
          </Link>
        </Dropdown.Item>

        <Dropdown.Item eventKey="2">
          <Link to="/Maow" style={{ textDecoration: 'none', color: 'inherit' }}>
            Maow
          </Link>
        </Dropdown.Item>
      </DropdownButton>
    </div>
  );
};

export default Targets;
